import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const initialBooks = [
  { title: "The Happiness Trap", image: "./HappyBook.jpg" },
  { title: "Feeling Good: The New Mood Therapy", image: "./FeelBook.jpg" },
  { title: "The Body Keeps the Score", image: "./BodyBook.jpg" },
  { title: "Mind Over Mood", image: "./MindBook.jpg" },
  { title: "The Subtle Art of Growth", image: "./GrowthBook.jpg" },
  { title: "Hope in the Darkness", image: "./HopeBook.jpg" },
];

const counselors = [
  { id: 1, name: "Dr. Jane Smith", issue: "Anxiety", rating: 4.8, image: "./Counselor1.jpg" },
  { id: 2, name: "Dr. Robert Johnson", issue: "Depression", rating: 4.6, image: "./Counselor2.jpg" },
  { id: 3, name: "Dr. Emily Davis", issue: "Stress Management", rating: 4.7, image: "./Counselor3.jpg" },
  { id: 4, name: "Dr. Michael Brown", issue: "Trauma", rating: 4.9, image: "./Counselor4.jpg" },
  { id: 5, name: "Dr. Sarah Wilson", issue: "Self-Esteem", rating: 4.5, image: "./Counselor5.jpg" },
];

const Home = () => {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState("");
  const [books, setBooks] = useState(initialBooks);

  const filteredCounselors = counselors.filter((counselor) =>
    counselor.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleAddBook = (title, image) => {
    setBooks((prevBooks) => [...prevBooks, { title, image }]);
  };

  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <h2 className="brand-name">SMHS</h2>
        <ul className="nav-links">
          <li>
            <button onClick={() => navigate("/home")} className="nav-link">Home</button>
          </li>
          <li>
            <button onClick={() => navigate("/one-on-one-sessions")} className="nav-link">One-on-One Sessions</button>
          </li>
          <li>
            <button onClick={() => navigate("/virtual-sessions")} className="nav-link">Virtual Sessions</button>
          </li>
          <li>
            <button onClick={() => navigate("/about-us")} className="nav-link">About Us</button>
          </li>
          <li>
            <button onClick={() => navigate("/login")} className="logout-button">Logout</button>
          </li>
        </ul>
      </nav>

      {/* Hero Section */}
      <header className="hero-section">
        <h1>Welcome to SMHS</h1>
        <p>Your one-stop solution for mental health resources and support</p>
      </header>

      {/* Recommended Books Section */}
      <section id="books" className="section">
        <h2>Recommended Books</h2>
        <div className="scrolling-books-container">
          <div className="scrolling-books">
            {books.map((book, index) => (
              <div className="book-card" key={index}>
                <img src={book.image} alt={book.title} />
                <p>{book.title}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Counselors Section */}
      <section id="counselors" className="section">
        <h2>Counselors</h2>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search counselor by name..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>
        <div className="counselors-list">
          {filteredCounselors.map((counselor) => (
            <div className="counselor-card" key={counselor.id}>
              <img src={counselor.image} alt={counselor.name} />
              <h3>{counselor.name}</h3>
              <p>Specialized in: {counselor.issue}</p>
              <p>Rating: ⭐ {counselor.rating}</p>
            </div>
          ))}
          {filteredCounselors.length === 0 && (
            <p className="no-results">No counselors found.</p>
          )}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2024 SMHS. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
